    state.encounters.push(...encounters);
    // state.encounters = state.encounters.filter(obj => Object.keys(obj).length);
    // console.log({ encounters: state.encounters })
    console.log(
      encounters.length,
      `# of filtered encounters found in OMRS for ${patientUuid}`
    );

    return state;
  })
);

